import React from "react";

function ProjectView(props) {
    render()
    {
        if (props.selectedProject === 'eaturveg') return <a href="https://iguannalin.github.io/eaturveg/">View
            Project</a>
        else if (props.selectedProject === 'spotify') return <a
            href="https://iguannalin.github.io/spotify-recently-added/">View Project</a>
        else if (props.selectedProject === 'filmotography') return <a href="https://annaylin.com/filmotography">View
            Project</a>
    }
}

export default ProjectView;
